  ko.components.register("documentsubmission", {
    viewModel: require("./vm/documentsubmission"),
    template: "<!-- Template for the document submission form. Data binding context: DocumentSubmission -->\n<div>\n  <h3 class=\"heading text-center\">So funktioniert's:</h3>\n  <span>\n    <ul class=\"col-md-offset-4 col-md-5\">\n      <li>(Von der Fachschaft Protokolle gegen Pfand kaufen.)</li>\n      <li>Prüfung ablegen.</li>\n      <li>Protokollvorlage von <a href=\"https://www.fsmi.uni-karlsruhe.de/Pruefungen/Muendlich.html#Protokollvorlagen\">der Fachschaftshomepage</a> herunterladen und ausfüllen.</li>\n      <li>Formular unten ausfüllen, Protokoll in PDF-Form hochladen.</li>\n      <li>In die Fachschaft kommen, Namen sagen, Pfand zurückbekommen.</li>\n    </ul>\n  </span>\n</div>\n<hr style=\"clear: both;\">\n<form class=\"form-horizontal\" data-bind=\"submit: submit.bind($data)\">\n  <div class=\"form-group\">\n    <label class=\"control-label col-md-3\">Vorlesungen&nbsp;</label>\n    <div class=\"col-md-8\">\n      <select class=\"form-control\" id=\"doc-submission-lectures\" multiple=\"true\" data-bind=\"tagsinput: {\n            confirmKeys: [13],\n            items: ko.getObservable($data, 'selectedLectures'),\n            freeInput: true,\n            typeaheadjs: [null, typeaheadDataset('lectures')],\n          }\"></select>\n      <span class=\"help-block\">\n        Vorlesung nicht in der Vorschlagsliste? Passt schon, einfach Namen eingeben &amp; Enter drücken.\n      </span>\n    </div>\n  </div>\n  <div class=\"form-group\">\n    <label class=\"control-label col-md-3\">An welcher Fakultät wird die Prüfung angeboten?&nbsp;</label>\n    <div class=\"col-md-8 btn-group btn-group-nowrap\">\n      <button class=\"btn btn-default\" data-bind=\"click: function() { department = 'computer science'; }, css: { 'active': department === 'computer science'}\">Informatik</button>\n      <button class=\"btn btn-default\" data-bind=\"click: function() { department = 'mathematics'; }, css: { 'active': department === 'mathematics'}\">Mathematik</button>\n      <button class=\"btn btn-default\" data-bind=\"click: function() { department = 'other'; }, css: { 'active': department === 'other'}\">Andere (Ergänzungsfach)</button>\n    </div>\n  </div>\n  <div class=\"form-group\">\n    <label class=\"control-label col-md-3\">Prüfer&nbsp;</label>\n    <div class=\"col-md-8\">\n      <select class=\"form-control\" id=\"doc-submission-examinants\" multiple=\"true\" data-bind=\"tagsinput: {\n            confirmKeys: [13],\n            items: ko.getObservable($data, 'selectedExaminants'),\n            freeInput: true,\n            typeaheadjs: [null, typeaheadDataset('examinants')],\n          }\"></select>\n      <span class=\"help-block\">\n        Prüfer nicht in der Vorschlagsliste? Passt schon, einfach Namen eingeben &amp; Enter drücken.\n      </span>\n    </div>\n  </div>\n  <div class=\"form-group\">\n    <label class=\"control-label col-md-3\">Datum&nbsp;</label>\n    <div class=\"col-md-8\">\n      <input class=\"form-control\" type=\"text\" required=\"required\" data-bind=\"value: date, datepicker: {\n        weekStart: 1,\n        daysOfWeekDisabled: '0,6',\n        format: 'yyyy-mm-dd',\n        language: 'de',\n        todayHighlight: true,\n        autoclose: true,\n      }\">\n    </div>\n  </div>\n  <div class=\"form-group\">\n    <label class=\"control-label col-md-3\">Dein Name&nbsp;</label>\n    <div class=\"col-md-8\">\n      <input class=\"form-control\" type=\"text\" data-bind=\"value: name, disable: anonymous, attr: { 'required': !anonymous }\">\n    </div>\n    <div class=\"col-md-3\"></div>\n    <div class=\"col-md-8\">\n      <div class=\"checkbox\">\n        <label>\n          <input type=\"checkbox\" data-bind=\"checked: anonymous\"> Ohne Namen abgeben (falls du kein Pfand zurückbekommen möchtest).\n        </label>\n      </div>\n    </div>\n  </div>\n  <div class=\"form-group\">\n    <label class=\"control-label col-md-3\">Datei (.pdf)&nbsp;</label>\n    <div class=\"col-md-8\">\n      <input class=\"form-control\" type=\"file\" accept=\".pdf\" required=\"required\" data-bind=\"event: { change: function() { file = $element.files[0]; }}\">\n      Bitte überprüfe folgendes vor dem Upload, damit dein Protokoll angenommen wird:\n      <ul>\n        <li>Hast du das Protokoll vollständig ausgefüllt?</li>\n        <li>Das Protokoll sollte keine Leerseiten enthalten.</li>\n        <li>Versuche Seiten mit nur einigen Zeilen Text zu vermeiden.</li>\n        <li>Hast du die PDF aus Word (o.Ä.) exportiert? Dann überprüfe, ob die Seitenumbrüche noch stimmen.</li>\n      </ul>\n    </div>\n  </div>\n  <div class=\"form-group\">\n    <div class=\"col-md-offset-3 col-md-8 btn-group btn-group-nowrap\">\n      <button class=\"btn btn-default\" data-bind=\"click: function() { doctype = 'oral'; }, css: { 'active': doctype === 'oral'}\">Mündliche Prüfung</button>\n      <button class=\"btn btn-default\" data-bind=\"click: function() { doctype = 'oral reexam'; }, css: { 'active': doctype === 'oral reexam'}\" title=\"Mündliche Nachprüfung einer schriftlichen Klausur\">Mündliche Nachprüfung</button>\n    </div>\n  </div>\n  <div class=\"form-group\">\n    <hr style=\"clear: both;\">\n  </div>\n  <div>\n    <div class=\"col-md-offset-3 col-md-8\">\n      <input class=\"btn btn-primary\" type=\"submit\" value=\"Abschicken\" data-bind=\"enable: submissionEnabled\">\n      <div class=\"form-control-inline icon-placeholder\">\n        <div class=\"icon text-right\" data-bind=\"css: { 'spinner icon-spinner active': status === 'waiting',\n          'icon-ok text-success': status === 'success',\n          'icon-attention text-warning': status === 'error' }\"></div>\n      </div>\n      <span class=\"text-warning\" data-bind=\"text: errorlabel\"></span>\n    </div>\n  </div>\n</form>\n" });
  ko.components.register("transcriptmigration", {
    viewModel: require("./vm/transcriptmigration"),
    template: "<!-- Template for the transcript migration form. Data binding context: TranscriptMigration -->\n<div class=\"container-fluid\">\n  <div class=\"row\">\n    <div class=\"col-md-6\">\n      <h3 class=\"heading\">Neues Protokoll</h3>\n      <form class=\"form-horizontal\" data-bind=\"submit: submit.bind($data)\">\n        <div class=\"form-group\">\n          <label class=\"control-label col-md-3\">Datum<span style=\"color: red;\">*</span>&nbsp;</label>\n          <div class=\"col-md-8\">\n            <input class=\"form-control\" id=\"transcript-migration-date\" type=\"text\" placeholder=\"YYYY[-MM[-TT]]\" required=\"required\" data-bind=\"value: date, hasfocus: dateFieldHasFocus\">\n          </div>\n        </div>\n        <div class=\"form-group\">\n          <label class=\"control-label col-md-3\">Vorlesungen&nbsp;</label>\n          <div class=\"col-md-8\">\n            <select class=\"form-control\" id=\"transcript-migration-lectures\" multiple=\"true\" data-bind=\"tagsinput: {\n                  confirmKeys: [13],\n                  items: ko.getObservable($data, 'selectedLectures'),\n                  freeInput: true,\n                  typeaheadjs: [null, lecturesTypeaheadDataset],\n                }\"></select>\n          </div>\n          <div class=\"col-md-3\"></div>\n          <div class=\"col-md-8\">\n            <span data-bind=\"visible: recentLectures.length > 0\">Zuletzt:</span>\n            <!-- ko foreach: recentLectures -->\n              <a href=\"#\" data-bind=\"text: $data, click: function(data, event) { $('#transcript-migration-lectures').tagsinput('add', $data); }\"></a>\n              <span data-bind=\"visible: $index() < $parent.recentLectures.length - 1\">&middot;</span>\n            <!-- /ko -->\n          </div>\n        </div>\n        <div class=\"form-group\">\n          <label class=\"control-label col-md-3\">Prüfer&nbsp;</label>\n          <div class=\"col-md-8\">\n            <select class=\"form-control\" id=\"transcript-migration-examinants\" multiple=\"true\" data-bind=\"tagsinput: {\n                  confirmKeys: [13],\n                  items: ko.getObservable($data, 'selectedExaminants'),\n                  freeInput: true,\n                  typeaheadjs: [null, examinantsTypeaheadDataset],\n                }\"></select>\n          </div>\n          <div class=\"col-md-3\"></div>\n          <div class=\"col-md-8\">\n            <span data-bind=\"visible: recentExaminants.length > 0\">Zuletzt:</span>\n            <!-- ko foreach: recentExaminants -->\n              <a href=\"#\" data-bind=\"text: $data, click: function(data, event) { $('#transcript-migration-examinants').tagsinput('add', $data); }\"></a>\n              <span data-bind=\"visible: $index() < $parent.recentExaminants.length - 1\">&middot;</span>\n            <!-- /ko -->\n          </div>\n        </div>\n        <div class=\"form-group\">\n          <label class=\"control-label col-md-3\">Datei (.pdf)&nbsp;</label>\n          <div class=\"col-md-8\">\n            <input class=\"form-control\" type=\"file\" accept=\".pdf\" required=\"required\" data-bind=\"event: { change: function() { file = $element.files[0]; }}\">\n          </div>\n        </div>\n        <div class=\"form-group\">\n          <div class=\"col-md-offset-3 col-md-8 btn-group btn-group-nowrap\">\n            <button class=\"btn btn-default\" data-bind=\"click: function() { doctype = 'oral'; }, css: { 'active': doctype === 'oral'}\">Mündliche Prüfung</button>\n            <button class=\"btn btn-default\" data-bind=\"click: function() { doctype = 'oral reexam'; }, css: { 'active': doctype === 'oral reexam'}\">Mündlicher Drittversuch</button>\n          </div>\n        </div>\n        <div class=\"form-group\">\n          <span class=\"col-md-offset-3\" style=\"color: red;\">* Muss ausgefüllt werden um ähnliche Protokolle zu suchen</span>\n          <hr style=\"clear: both;\">\n        </div>\n        <div>\n          <div class=\"col-md-offset-3 col-md-8\">\n            <input class=\"btn btn-primary\" type=\"submit\" value=\"Abschicken\" data-bind=\"enable: submissionEnabled\">\n            <div class=\"form-control-inline icon-placeholder\">\n              <div class=\"icon text-right\" data-bind=\"css: { 'spinner icon-spinner active': status === 'waiting',\n                'icon-ok text-success': status === 'success',\n                'icon-attention text-warning': status === 'error' }\"></div>\n            </div>\n            <span class=\"text-warning\" data-bind=\"text: errorlabel\"></span>\n          </div>\n        </div>\n      </form>\n    </div>\n    <div class=\"col-md-6\">\n      <h3 class=\"heading\">Ähnliche Protokolle</h3>\n        <table class=\"table table-condensed\">\n          <thead>\n            <tr>\n              <td>Vorlesungen</td>\n              <td>Prüfer</td>\n              <td>Datum</td>\n              <td></td>\n            </tr>\n          </thead>\n          <tbody data-bind=\"foreach: similar\">\n            <tr class=\"list selectable\">\n              <td>\n                <ul class=\"lecture-list-cell\" data-bind=\"foreach: lectures\">\n                  <li data-bind=\"text: name\"></li>\n                </ul>\n              </td>\n              <td>\n                <ul class=\"lecture-list-cell\" data-bind=\"foreach: examinants\">\n                  <li data-bind=\"text: name\"></li>\n                </ul>\n              </td>\n              <td data-bind=\"date: date\"></td>\n              <td>\n                <a\n                  class='icon-button btn btn-default btn-compact icon-eye selected'\n                  title=\"Vorschau\"\n                  data-bind=\"\n                    click: function() { window.open(previewURL, '_blank'); },\n                    clickBubble: false\n                  \"></a>\n                <a\n                   class='icon-button btn btn-default btn-compact icon-edit selected'\n                   title=\"Bearbeiten\"\n                   data-bind=\"\n                   click: function() { window.open(editURL, '_blank') },\n                   clickBubble: false,\n                   \"></a>\n              </td>\n            </tr>\n          </tbody>\n        </table>\n    </div>\n  </div>\n</div>\n" });

